import "react-native-gesture-handler";
import { StatusBar } from "expo-status-bar";
import React, { useEffect, useState } from "react";
import { StyleSheet, Text, View } from "react-native";
import { Provider as PaperProvider } from "react-native-paper";
import { Provider as ReduxProvider } from "react-redux";
import AppbarBottom from "./app/components/AppbarBottom";
import AppBarTop from "./app/components/AppBarTop";
import configureStore from "./app/store/store";
import { getDailyreports } from "./app/api/apiTest";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import { Home } from "./app/views/Home";

const Stack = createStackNavigator();
export default function App() {
  const [test, setTest] = useState();
  useEffect(() => {
    getDailyreports("v3/967cffba-f2e0-4270-b70f-293e7ee895b1").then(
      (response) => {
        setTest(response.data.test);
        // console.log(response.data);
      }
    );
  }, []);

  return (
    <ReduxProvider store={configureStore}>
      <PaperProvider>
        <AppBarTop />
        <View style={styles.container}>
          <Text>Open up App.js to start working on your app!</Text>
          {test?.map((x, key) => (
            <Text key={key}>
              {x.id} {x.message}
            </Text>
          ))}
          <NavigationContainer>
            <Stack.Navigator>
              <Stack.Screen name="Home" component={HomeScreen} />
              <Stack.Screen name="Friends" component={FriendsScreen} />
            </Stack.Navigator>
          </NavigationContainer>
          <StatusBar style="auto" />
          <AppbarBottom />
        </View>
      </PaperProvider>
    </ReduxProvider>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "gray",
    alignItems: "center",
    justifyContent: "center",
  },
});
